import logo from '../../images/logo.svg';
import Navigation from '../Navigation/Navigation';
import { Link, Outlet } from 'react-router-dom';

export default function Header({ blackColor }) {
  return (
    <>
      <header className={`header ${blackColor ? "header__blue-background" : ""} `}>
        <Link to={"/"}><img src={logo} alt="Логотип сайта про диплом" className="header__logo" /></Link>
        <Navigation isAutorized />
      </header>
      <Outlet />
    </>
  )
}
